import "./setgame.css";
/* <!--Game Picture --> */
import pacman from "../../assets/LogoGame/pacman.png";
import metalslug from "../../assets/LogoGame/metal slug.jpg";
import CadillacAndDinosaurs from "../../assets/LogoGame/Cadillac and Dinosaurs.png";
import Tetris from "../../assets/LogoGame/1.jfif";
import Pinball from "../../assets/LogoGame/3D Pinball.jpg";
import SnakeGame from "../../assets/LogoGame/gobble snake game.webp";
/* <!--Game Link --> */

const setgame = () => {
    return (
    <div className='game-container'>
        <img className='game-avatar' src={pacman}/>
            <label className='game-label'/>
                
    </div>    
          
    );
};
export default setgame;
